import React from "react";

const ArticleCard = ({ article }) => {
  return (
    <div>
      <h3>{article.title}</h3>
      <p>{article.author}</p>
      <p>{article.votes}</p>
      <p>{article.comments}</p>
    </div>
  );
};

export default ArticleCard;
